Portfolio portfolioFromJson(String str) => Portfolio.fromJson(json.decode(str));
String portfolioToJson(Portfolio data) => json.encode(data.toJson());
class Portfolio {
  Portfolio({
      String? asset, 
      List<Objectives>? objectives,}){
    _asset = asset;
    _objectives = objectives;
}

  Portfolio.fromJson(dynamic json) {
    _asset = json['asset'];
    if (json['objectives'] != null) {
      _objectives = [];
      json['objectives'].forEach((v) {
        _objectives?.add(Objectives.fromJson(v));
      });
    }
  }
  String? _asset;
  List<Objectives>? _objectives;
Portfolio copyWith({  String? asset,
  List<Objectives>? objectives,
}) => Portfolio(  asset: asset ?? _asset,
  objectives: objectives ?? _objectives,
);
  String? get asset => _asset;
  List<Objectives>? get objectives => _objectives;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['asset'] = _asset;
    if (_objectives != null) {
      map['objectives'] = _objectives?.map((v) => v.toJson()).toList();
    }
    return map;
  }

}

